import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./components/L";
import SignUp from "./components/S";
import ForgotPass from "./components/ForgotPass";
import CheckEmail from "./components/CheckEmail";
import SetNewPass from "./components/SetNewPass";
import Done from "./components/Done";

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Define all your routes here */}
        <Route path="/" element={<Login />} />                           {/* Login */}
        <Route path="/signup" element={<SignUp />} />                    {/* Sign Up */}
        <Route path="/forgot-password" element={<ForgotPass />} />       {/* Forgot Password */}
        <Route path="/check-email" element={<CheckEmail />} />           {/* Check Email */}
        <Route path="/set-new-password" element={<SetNewPass />} />      {/* Set New Password */}
        <Route path="/done" element={<Done />} />                        {/* Success/Completion */}
      </Routes>
    </Router>
  );
};

export default App;
